(1, 1, '0e01b388d79e24d55a85174accefda38', 'smallbox', 'area1', 0, NULL, '{"name":"\\u0639\\u062f\\u062f \\u0627\\u0644\\u0645\\u0644\\u0627\\u0639\\u0628","icon":"ion-ios-football","color":"bg-green","link":"http:\\/\\/almala3b.com\\/admin\\/playgrounds?m=97","sql":"select count(id) from playgrounds WHERE deleted_at IS null"}', '2017-07-25 13:49:48', NULL),
(2, 1, '120c5d7f4140d6345c994d654683a5d9', 'smallbox', 'area2', 0, NULL, '{"name":"\\u0639\\u062f\\u062f \\u0627\\u0644\\u0627\\u0639\\u0628\\u064a\\u0646","icon":"ion-ios-people","color":"bg-aqua","link":"http:\\/\\/almala3b.com\\/admin\\/users28?m=61","sql":"select count(id) from users WHERE type = \'player\'"}', '2017-07-25 13:49:50', NULL),
(3, 1, '1128892bc9d48d8bc05fc6675f84896e', 'smallbox', 'area3', 0, NULL, '{"name":"\\u0639\\u062f\\u062f \\u0627\\u0644\\u062d\\u062c\\u0648\\u0632\\u0627\\u062a","icon":"ion-compose","color":"bg-yellow","link":"http:\\/\\/almala3b.com\\/admin\\/reservations?m=59","sql":"select count(id) from reservations WHERE confirmed = \'1\' and deleted_at is null"}', '2017-07-25 13:49:52', NULL),
(4, 1, '33356dc4986651da4066cdc345accee0', 'table', 'area5', 0, NULL, '{"name":"\\u0627\\u0644\\u0644\\u0627\\u0639\\u0628\\u064a\\u0646 \\u0627\\u0644\\u0630\\u064a\\u0646 \\u062d\\u0627\\u0632\\u0648\\u0627 \\u0639\\u0644\\u0649 \\u062c\\u0648\\u0627\\u0626\\u0632 \\u0648\\u0644\\u0645 \\u064a\\u062a\\u0645 \\u0627\\u0631\\u0633\\u0627\\u0644\\u0647\\u0627 \\u0627\\u0644\\u064a\\u0647\\u0645:","sql":"select  u.name as `\\u0627\\u0633\\u0645 \\u0627\\u0644\\u0644\\u0627\\u0639\\u0628`, p.name as `\\u0627\\u0633\\u0645 \\u0627\\u0644\\u062c\\u0627\\u0626\\u0632\\u0629`,h.id as`button` from user_prizes_history as h \\r\\ninner join users as u on  u.id = h.user_id\\r\\ninner join prizes as p on  p.id = h.prize_id\\r\\nwhere h.sent_at is null"}', '2017-08-03 12:33:53', NULL),
(5, 2, '6ec731e4f046660c18ff92bc50aced76', 'smallbox', 'area1', 0, NULL, '{"name":"\\u0639\\u062f\\u062f \\u0627\\u0644\\u0645\\u0644\\u0627\\u0639\\u0628","icon":"ion-ios-football","color":"bg-green","link":"http:\\/\\/almala3b.com\\/admin\\/playgrounds?m=104","sql":"select count(id) from playgrounds WHERE deleted_at IS null and user_id = [admin_id]"}', '2017-09-27 12:54:39', NULL),
(6, 2, 'ef6465168abf093135a26dc3e155e620', 'smallbox', NULL, 0, 'Untitled', NULL, '2017-09-28 06:11:39', NULL),
(7, 2, '720dd792b1385627b7d871399f06aabd', 'smallbox', 'area2', 0, NULL, '{"name":"\\u0639\\u062f\\u062f \\u0627\\u0644\\u062d\\u062c\\u0648\\u0632\\u0627\\u062a","icon":"ion-compose","color":"bg-red","link":"http:\\/\\/almala3b.com\\/admin\\/reservations?m=103","sql":"select count(reservations.id) from reservations INNER JOIN playgrounds ON reservations.pg_id = playgrounds.id \\r\\nWHERE reservations.confirmed = \'1\' and reservations.deleted_at is null AND playgrounds.user_id = [admin_id];"}', '2017-09-28 06:11:43', NULL),
(8, 2, '5cf33aeeaa78a99e54efb1f55d2ce6f5', 'smallbox', 'area3', 0, NULL, '{"name":"\\u0627\\u062c\\u0645\\u0627\\u0644\\u064a \\u0639\\u0627\\u0626\\u062f \\u0627\\u0644\\u062d\\u062c\\u0648\\u0632\\u0627\\u062a","icon":"ion-cash","color":"bg-yellow","link":"http:\\/\\/almala3b.com\\/admin\\/paymenReport?m=142","sql":"select SUM(total) from ( SELECT COUNT(r.id) AS reserved, p.price * COUNT(r.id)  AS total from `playgrounds` as `p` left join `reservations` as `r` on `p`.`id` = `r`.`pg_id` inner join `users` as `u` on `p`.`user_id` = `u`.`id` left join `users` as `um` on `u`.`marketer_id` = `um`.`id` where `r`.`attendance` = 1 and `p`.`user_id` = [admin_id] group by `p`.`id`) as x"}', '2017-09-28 06:44:35', NULL);
