(2, 'من نحن', 'من نحن محتوى الصفحة من نحن محتوى الصفحة من نحن محتوى الصفحة من نحن محتوى الصفحة', '2017-04-11 15:33:13', '2017-10-06 00:34:58', NULL),
(3, 'سياسة الخصوصية', 'Privacy Policy of almala3b\r\nThis Application collects some Personal Data from its Users.\r\n\r\nPolicy summary\r\nPersonal Data collected for the following purposes and using the following services:\r\nAccess to third party accounts\r\nFacebook account access\r\nPermissions: Email\r\n\r\nFull policy\r\nData Controller and Owner\r\nTypes of Data collected\r\nThe owner does not provide a list of Personal Data types collected.\r\n\r\nOther Personal Data collected may be described in other sections of this privacy policy or by dedicated explanation text contextually with the Data collection.\r\nThe Personal Data may be freely provided by the User, or collected automatically when using this Application.\r\nAny use of Cookies - or of other tracking tools - by this Application or by the owners of third party services used by this Application, unless stated otherwise, serves to identify Users and remember their preferences, for the sole purpose of providing the service required by the User.\r\nFailure to provide certain Personal Data may make it impossible for this Application to provide its services.\r\nUsers are responsible for any Personal Data of third parties obtained, published or shared through this Application and confirm that they have the third party\'s consent to provide the Data to the Owner.\r\n\r\nMode and place of processing the Data\r\nMethods of processing\r\nThe Data Controller processes the Data of Users in a proper manner and shall take appropriate security measures to prevent unauthorized access, disclosure, modification, or unauthorized destruction of the Data.\r\nThe Data processing is carried out using computers and/or IT enabled tools, following organizational procedures and modes strictly related to the purposes indicated. In addition to the Data Controller, in some cases, the Data may be accessible to certain types of persons in charge, involved with the operation of the site (administration, sales, marketing, legal, system administration) or external parties (such as third party technical service providers, mail carriers, hosting providers, IT companies, communications agencies) appointed, if necessary, as Data Processors by the Owner. The updated list of these parties may be requested from the Data Controller at any time.\r\nPlace\r\nThe Data is processed at the Data Controller\'s operating offices and in any other places where the parties involved with the processing are located. For further information, please contact the Data Controller.\r\n\r\nRetention time\r\nThe Data is kept for the time necessary to provide the service requested by the User, or stated by the purposes outlined in this document, and the User can always request that the Data Controller suspend or remove the data.\r\n\r\nThe use of the collected Data\r\nThe Data concerning the User is collected to allow the Owner to provide its services, as well as for the following purposes: Access to third party accounts.\r\n\r\nThe Personal Data used for each purpose is outlined in the specific sections of this document.\r\n\r\nFacebook permissions asked by this Application\r\nThis Application may ask for some Facebook permissions allowing it to perform actions with the User\'s Facebook account and to retrieve information, including Personal Data, from it. This service allows this Application to connect with the User\'s account on the Facebook social network, provided by Facebook Inc.\r\n\r\nFor more information about the following permissions, refer to the Facebook permissions documentation and to the Facebook privacy policy.\r\n\r\nThe permissions asked are the following:\r\n\r\nBasic information\r\nBy default, this includes certain User’s Data such as id, name, picture, gender, and their locale. Certain connections of the User, such as the Friends, are also available. If the User has made more of their Data public, more information will be available.\r\n\r\nEmail\r\nProvides access to the User\'s primary email address.\r\n\r\nDetailed information on the processing of Personal Data\r\nPersonal Data is collected for the following purposes and using the following services:\r\n\r\nAccess to third party accounts\r\nThis type of service allows this Application to access Data from your account on a third party service and perform actions with it.\r\nThese services are not activated automatically, but require explicit authorization by the User.\r\nFacebook account access (This Application)\r\n\r\nThis service allows this Application to connect with the User\'s account on the Facebook social network, provided by Facebook, Inc.\r\n\r\nPermissions asked: Email.\r\n\r\nPlace of processing: US – Privacy Policy\r\n\r\nAdditional information about Data collection and processing\r\nLegal action\r\nThe User\'s Personal Data may be used for legal purposes by the Data Controller, in Court or in the stages leading to possible legal action arising from improper use of this Application or the related services.\r\nThe User declares to be aware that the Data Controller may be required to reveal personal data upon request of public authorities.\r\nAdditional information about User\'s Personal Data\r\nIn addition to the information contained in this privacy policy, this Application may provide the User with additional and contextual information concerning particular services or the collection and processing of Personal Data upon request.\r\n\r\nSystem logs and maintenance\r\nFor operation and maintenance purposes, this Application and any third party services may collect files that record interaction with this Application (System logs) or use for this purpose other Personal Data (such as IP Address).\r\n\r\nInformation not contained in this policy\r\nMore details concerning the collection or processing of Personal Data may be requested from the Data Controller at any time. Please see the contact information at the beginning of this document.\r\n\r\nThe rights of Users\r\nUsers have the right, at any time, to know whether their Personal Data has been stored and can consult the Data Controller to learn about their contents and origin, to verify their accuracy or to ask for them to be supplemented, cancelled, updated or corrected, or for their transformation into anonymous format or to block any data held in violation of the law, as well as to oppose their treatment for any and all legitimate reasons. Requests should be sent to the Data Controller at the contact information set out above.\r\n\r\nThis Application does not support �Do Not Track� requests.\r\nTo determine whether any of the third party services it uses honor the �Do Not Track� requests, please read their privacy policies.\r\nChanges to this privacy policy\r\nThe Data Controller reserves the right to make changes to this privacy policy at any time by giving notice to its Users on this page. It is strongly recommended to check this page often, referring to the date of the last modification listed at the bottom. If a User objects to any of the changes to the Policy, the User must cease using this Application and can request that the Data Controller remove the Personal Data. Unless stated otherwise, the then-current privacy policy applies to all Personal Data the Data Controller has about Users.\r\n\r\nInformation about this privacy policy\r\nThe Data Controller is responsible for this privacy policy, prepared starting from the modules provided by Iubenda and hosted on Iubenda\'s servers.\r\n\r\nDefinitions and legal references\r\nPersonal Data (or Data)\r\n\r\nAny information regarding a natural person, a legal person, an institution or an association, which is, or can be, identified, even indirectly, by reference to any other information, including a personal identification number.\r\n\r\nUsage Data\r\n\r\nInformation collected automatically from this Application (or third party services employed in this Application), which can include: the IP addresses or domain names of the computers utilized by the Users who use this Application, the URI addresses (Uniform Resource Identifier), the time of the request, the method utilized to submit the request to the server, the size of the file received in response, the numerical code indicating the status of the server\'s answer (successful outcome, error, etc.), the country of origin, the features of the browser and the operating system utilized by the User, the various time details per visit (e.g., the time spent on each page within the Application) and the details about the path followed within the Application with special reference to the sequence of pages visited, and other parameters about the device operating system and/or the User\'s IT environment.\r\n\r\nUser\r\n\r\nThe individual using this Application, which must coincide with or be authorized by the Data Subject, to whom the Personal Data refers.\r\n\r\nData Subject\r\n\r\nThe legal or natural person to whom the Personal Data refers.\r\n\r\nData Processor (or Data Supervisor)\r\n\r\nThe natural person, legal person, public administration or any other body, association or organization authorized by the Data Controller to process the Personal Data in compliance with this privacy policy.\r\n\r\nData Controller (or Owner)\r\n\r\nThe natural person, legal person, public administration or any other body, association or organization with the right, also jointly with another Data Controller, to make decisions regarding the purposes, and the methods of processing of Personal Data and the means used, including the security measures concerning the operation and use of this Application. The Data Controller, unless otherwise specified, is the Owner of this Application.\r\n\r\nThis Application\r\n\r\nThe hardware or software tool by which the Personal Data of the User is collected.\r\n\r\nLegal information\r\n\r\nNotice to European Users: this privacy statement has been prepared in fulfillment of the obligations under Art. 10 of EC Directive n. 95/46/EC, and under the provisions of Directive 2002/58/EC, as revised by Directive 2009/136/EC, on the subject of Cookies.\r\n\r\nThis privacy policy relates solely to this Application.\r\n\r\nLatest update: May 25, 2017\r\n\r\niubenda hosts this page and collects some Personal Data about Users', '2017-06-06 13:38:41', '2017-10-01 09:16:52', NULL),
